class Solution {
public:
    int calculate(string s) {
        int len = s.size();
        if(len == 0) return 0;
        int res = 0, cur = 0, sign = 1;
        stack<int> st;
        for(int i = 0; i < len; i++) {
            if(s[i] == ' ') continue;
            if(s[i] == '+') {
                res += sign * cur;
                cur = 0;
                sign = 1;
            } else if(s[i] == '-') {
                res += sign * cur;
                cur = 0;
                sign = -1;
            } else if(s[i] == '(') {
                st.push(res);
                st.push(sign);
                res = 0;
                sign = 1;
            } else if(s[i] == ')') {
                res += sign * cur;
                cur = 0;
                res *= st.top();
                st.pop();
                res += st.top();
                st.pop();
            } else {
                cur = cur * 10 + s[i] - '0';
            }
        }
        res += sign * cur;
        return res;
    }
};

